import java.util.Arrays;

// Java program to demonstrate Arrays.hashCode() method

public class Methods_In_Java_Array_Example11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		// Get the Array
		int intAry[] = { 10, 20, 30, 40, 50 };
		
		// To get the hashCode of the arrays
		System.out.println("Integer Array: " + Arrays.hashCode(intAry));
	}
}
